import React, { useCallback, useState } from "react";
import "./App.css";

import { Hello } from "./Hello";

const App = () => {
  const [count, setCount] = useState(0);
  const increment = useCallback(
    (n) => {
      setCount((c) => c + n);
    },
    [setCount]
  );

  return (
    <div>
      <Hello increment={increment} />
      <div>count: {count}</div>
    </div>
  );
};
export default App;
